import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<div>GG</div>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
